INSERT INTO `nin_player_template` (`id`, `name`, `name_en`, `headId`, `bodyId`, `legId`, `menu`, `menu_en`, `say`, `say_en`, `menu_2`, `menu_2e`) VALUES
(0, 'Kanata', 'Kanata', 56, 57, 58, 'Binh khí;Gia tộc,Thành lập,Lãnh Địa Gia Tộc,Đổi túi quà,Hướng dẫn;Hang động sau trường,Nhận thưởng,Cấp 35,Cấp 45,Cấp 55,Cấp 65,Cấp 75,Cấp 95;Lôi đài,Thách đấu,Xem thi đấu,Kết quả,Ninja tài năng,Xếp hạng tài năng;Nói chuyện', 'Weapon;Clan,Establish,Clan Territory,Exchange for gift,Guide;Cave near school yard,Get the prize,Level 35,Level 45,Level 55,Level 65,Level 75,Level 95;Battle,Challenge,View Competition,Results,Ninja got talent,Ninja talent Ranking;Talk', 'Haha, nhà ngươi cần vũ khí gì?;Ở chỗ ta có rất nhiều binh khí có giá trị;Hãy chọn cho mình một món binh khí đi.', 'Hellooo, what kind of weapon do you need?;Kunai, Tanto, Shuriken, Fan, Bow, Blade...I have it all; Choose one now.', NULL, NULL),
(1, 'Furoya', 'Furoya', 77, 78, 79, 'Y phục,Nón,Áo,Găng tay,Quần,Giày;Nói chuyện', 'Costume,Cap,Cloth,Gloves,Cloths,Shoes;Talk;', 'Ngươi cần giày, giáp sắt, quần áo?;Giáp, giày giá rẻ đây!;Không mặc giáp mua từ ta, ra khỏi trường ngươi sẽ gặp nguy hiểm.', 'Heeyy, you need shoes, armor, or clothing?;All kind are here with a cheap price!;My ninja armor fits like skin, do you understand?', NULL, NULL),
(2, 'Ameji', 'Ameji', 47, 48, 49, 'Trang sức,Liên,Nhẫn,Ngọc bội,Phù;Nhiệm vụ danh vọng,Nhận,Trả,Huỷ,Nhận Geningan,Nâng cấp,Nâng cấp vip,Hướng dẫn;Nói chuyện', 'Jewelry,Necklace,Rings,Gems,Charms;Glory quest, Accept, Accomplish ,Cancel, Receive Legendary Eye, Upgrade, Upgrade vip, Help;Talk', 'Con cần mua ngọc bội, nhẫn, dây chuyền, bùa hộ thân à?;Trang sức không chỉ để ngắm, nó còn tăng sức mạnh của con;Con chọn loại trang sức gì nào?', 'Hi friend, in case you want to gems, necklaces, charms.. I am always have the best jewelry shop;In Shinobi world, it not only looks good, but will strengthen your body and mind, tell me what you need now.', NULL, NULL),
(3, 'Kiriko', 'Kiriko', 74, 75, 76, 'Dược phẩm (Yên);Dược phẩm (Xu);Nói chuyện', 'Medicine (Kin);Medicine (Coin);Talk', 'Đi đường cần mang theo ít dược phẩm;Không mang theo HP, MP bên mình, con sẽ gặp nguy hiểm.;Mua ngay HP, MP từ ta, được chế tạo từ loại thảo dược quý hiếm nhất.', 'Your journey can not be completed if you have not prepared carefully. How about taking some medicine with you;Its really dangerous out there without any medicine.;Buy my HP, MP bulb, all made from the best herbs.', NULL, NULL),
(4, 'Tabemono', 'Tabemono', 50, 51, 52, 'Thức ăn (Yên);Thức ăn (Xu);Nói chuyện;Thiên Địa bảng,Đăng ký, Chinh phục,Thiên bảng,Địa bảng', 'Food (Kin);Food (Coin);Talk', 'Hahaha, chắc ngươi đi đường cũng mệt rồi.;Thức ăn của ta là ngon nhất rồi!;Ăn xong bảo đảm ngươi sẽ quay lại lần sau.', 'My friend, are you hungry, I can hear the song from your stomach!!!;My food is the best of the best!;Try it, I promise you\'ll like it!!.', 'Thức ăn (Yên);Thức ăn (Xu);Nói chuyện;Đấu trường, Danh sách;Kim bảng,Thiên,Địa', 'Food (Kin);Food (Coin);Talk;Đấu trường, Danh sách;Kim bảng,Thiên,Địa'),
(5, 'Kamakura', 'Kamakura', 80, 81, 82, 'Mở rương;Lưu tọa độ;Vùng Đất Ma Quỷ,Đi tới,Hướng dẫn;Nói chuyện', 'Open Chest;Save location;Cursed Land,Enter,Help;Talk', 'Ta giữ đồ chưa hề để thất lạc bao giờ.;Trên người của ngươi toàn là những đồ có giá trị, sao không cất bớt ở đây?; Hãy an tâm giao đồ cho ta nào!', 'I offer the best Storage service.;I can see you have many valuable items, so why not use my service?;Trust me, my family did this business for more than 100 years!', NULL, NULL),
(6, 'Kenshinto', 'Kenshinto', 68, 69, 70, 'Nâng cấp,Thường,Cẩn thận,Hướng dẫn;Luyện đá,Yên,Xu;Tách;Chuyển hóa;Luyện ngọc;Khảm;Gọt Ngọc;Tháo Ngọc;Nói chuyện', 'Upgrade,Normal,Careful,Guide;Train stone,Kin,Coin;Split;Tranfer;Leveling gem, Socketing, Roasting gem, Extracting gem;Talk', 'Ngươi muốn cải tiến trang bị?;Đảm bảo sau khi nâng cấp đồ của ngươi sẽ tốt hơn hẳn;Nâng cấp trang bị: Uy tính, giá cả phải chăng.', 'Your weapon is looking a little dull?  Give it to me for more power; I offer a quality service at a reasonable price.', NULL, NULL),
(7, 'Umayaki', 'Umayaki', 62, 63, 64, 'Nói chuyện;Làng Kojin;Làng Sanzu;Làng Tone;Làng chài;Làng Chakumi;Làng Echigo;Làng Oshin', 'Talk;Kojin village;Sanzu village;Tone village;Fish village;Chakumi village;Echigo village;Oshin village', 'Nhà ngươi muốn đi đâu?;Ngựa của ta rất khỏe, có thể chạy ngàn dặm;Đi xe kéo của ta, an toàn là số một.', 'Long journey, heavy luggage,...hihi you will need my service?;My horse can take you anywhere you want to, he can easily run a thousand miles like a piece of cake;Safety first, money second..hihihi.', NULL, NULL),
(8, 'Umayaki', 'Umayaki', 62, 63, 64, 'Trường Hirosaki;Trường Haruna;Trường Ookaza;Nói chuyện', 'Hirosaki school;Haruna school;Ookaza school;Talk', 'Nhà ngươi muốn đi đâu?;Ngựa của ta rất khỏe, có thể chạy ngàn dặm;Đi xe kéo của ta, an toàn là số một.', 'Long journey, heavy luggage,...hihi you will need my service?;My horse can take you anywhere you want to, he can easily run a thousand miles as easy as pie;Safety first, money second..hihihi.', NULL, NULL),
(9, 'Cô Toyotomi', 'Principal Toyotomi', 44, 45, 46, 'Bảng xếp hạng,Top đại gia,Top cao thủ,Top Gia Tộc,Top hang động;Nhập học,Ninja Kiếm,Ninja Phi Tiêu;Tẩy điểm,Tiềm năng,Kỹ năng;Nói chuyện;Giao chiến,Tham gia,Thành tích,Hướng dẫn', 'Ranking board,Top richmen,Top expert,Top clan;Entry,Sword Ninja,Shuriken Ninja;Reset point,Potential,Skills;Talk', 'Ngươi muốn trở thành hỏa Ninja thì học, không thì cút!;Theo học ở là đây là vinh hạnh của ngươi, biết chứ?;Trường ta dạy kiếm, và phi tiêu, chẳng dạy các vũ khí vô danh khác.', 'Hey! You want to be a Fire Ninja ?!.OK you have to follow all my order, or get out of here!; Be proud and never forget you are a part of this great school; Our school is master of sword and shuriken skills, only these wonderful weapons and not for any other useless weapons.', NULL, NULL),
(10, 'Thầy Ookamesama', 'Principal Ookamesama', 53, 54, 55, 'Bảng xếp hạng,Top đại gia,Top cao thủ,Top Gia Tộc,Top hang động;Nhập học,Ninja Kunai,Ninja Cung;Tẩy điểm,Tiềm năng,Kỹ năng;Nói chuyện;Giao chiến,Tham gia,Thành tích,Hướng dẫn', 'Ranking board,Top richmen,Top expert,Top clan;Entry,Kunai Ninja,Bow Ninja;Reset point,Potential,Skills;Talk', 'Con có cảm thấy lạnh không?;Tập trung học tốt nhé con.;Học, để thành tài, để thành người tốt, chứ không phải để ganh đua với đời.', 'My student, do you feel cold?!.;Focus on learning to be better; shinobi train is like a long and winding road and is not for the lazy!', NULL, NULL),
(11, 'Thầy Kazeto', 'Teacher Kazeto', 65, 66, 67, 'Bảng xếp hạng,Top đại gia,Top cao thủ,Top Gia Tộc,Top hang động;Nhập học,Ninja Đao,Ninja Quạt;Tẩy điểm,Tiềm năng,Kỹ năng;Nói chuyện;Giao chiến,Tham gia,Thành tích,Hướng dẫn', 'Ranking board,Top richmen,Top expert,Top clan;Entry,Blade Ninja,Fan Ninja;Reset point,Potential,Skills;Talk', 'Ngươi may mắn mới gặp được ta đó, ta vốn là Thần Gió mà!;So với các trường khác, trường Gió của chúng ta là tốt nhất;Một học sinh trường gió chúng ta có thể chấp hai học sinh các trường kia.', 'Hey!!! You\'re lucky to talk to me, I am God of Winds ..hahaha!; Compared to other schools, our school is the best of all, my students can deal with two students in other schools.', NULL, NULL),
(12, 'Tajima', 'Tajima', 71, 72, 73, 'Hướng dẫn,Cách chơi,Nhân vật,Chức năng PK,Lập nhóm,Luyện đá,Nâng cấp,Điểm hoạt động;Nói chuyện;Hủy vật phẩm và nhiệm vụ;Thứ thân;Chủ thân', 'Guide,Gameplay,Characters,PK function,Create Team,Train stone,Upgrade,Active Points;Talk;Remove items and tasks;Illusion;Main char', 'Ta là Tajima, mọi việc ở đây đều do ta quản lý.;Đi thưa, về trình, nhé các con;Làng Tone là ngôi làng cổ xưa, đã có từ rất lâu.', 'My little one, I am Tajima, headman of this village.;Be respectful of people, responsible for living, always remember who you are and where you came from;Tone village is an ancient village, this is an old story that began a long, long time ago.', NULL, NULL),
(13, 'Khu vực', 'Area', 0, 0, 0, '', '', '', '', NULL, NULL),
(14, 'Hashimoto', 'Hashimoto', 59, 60, 61, '', '', '', '', NULL, NULL),
(15, 'Fujiwara', 'Fujiwara', 89, 90, 91, '', '', '', '', NULL, NULL),
(16, 'Nao', 'Nao', 86, 87, 88, '', '', '', '', NULL, NULL),
(17, 'Jaian', 'Jaian', 96, 94, 95, '', '', '', '', NULL, NULL),
(18, 'Bà Rei', 'Mrs Rei', 83, 84, 85, 'Nói chuyện', 'Talk', 'Làng ta sống chủ yếu là nghề biển;Sống ở làng Chài thì con cần phải học cách đánh bắt cá.;Đây là Làng Chài, do ta quản lý.', 'Fishing is my job and is the job of most all my people; If you live here, you need to act like a fishman. Remenber, this is fish village, under my control.', NULL, NULL),
(19, 'Kirin', 'Kirin', 97, 98, 99, 'Nói chuyện', 'Talk', 'Ta là Kirin, ngôi làng này do ta cai quản.;Làng ta khí hậu ôn hòa cây cối quanh năm tươi tốt.;Dân làng sống ra hòa thuận, mọi người rất yêu hòa bình.', 'Kirin is my name, and I\'m headman.;Villagers here live in harmony, and are a peace-loving people.', NULL, NULL),
(20, 'Soba', 'Soba', 114, 115, 116, 'Nói chuyện', 'Talk', 'Ta là Soba, ngôi làng này do ta cai quản.;Làng ta nằm bên hai bờ suối nước mát trong xanh.;Trong làng có đầy đủ nhu yếu phẩm cần thiết cho một ninja.', 'Soba is my name, headman of this village.;Our village is located between two cool springs.;You can find some great stuffs for your journey in my village.', NULL, NULL),
(21, 'Sunoo', 'Sunoo', 117, 118, 119, 'Nói chuyện', 'Talk', 'Ta là Sunoo, ngôi làng này do ta cai quản;Khí hậu làng ta rất lạnh, sống ở đây phải chăm chỉ rèn luyện;Con thích săn bắn không? Ta rất thích đi săn bắn', 'Watashi Sunoosama..haha, this village is under my care;Maybe the gods do not favor my village much. It is crazyyy cold here, so you need training to live here;Do you like hunting? I love it!!', NULL, NULL),
(22, 'Guriin', 'Guriin', 120, 121, 122, 'Nói chuyện;Ninja đệ nhất,Tham gia;Bảng xếp hạng,Kiếm,Tiêu,Kunai,Cung,Đao,Quạt', 'Talk', 'Ta là Guriin, ngôi làng này do ta cai quản', 'Guriin is my name, headman of this village.', NULL, NULL),
(23, 'Matsurugi', 'Matsurugi', 100, 101, 102, 'Nói chuyện', 'Talk', 'Ta là Matsurugi, mọi người ở đây gọi ta là trưởng làng.;Làng ta khí hậu lạnh giá quanh năm băng tuyết bao phủ.;Ở đây lạnh lẽo khắc nghiệt, nhưng lòng người dân nơi đây thì ấm áp vô cùng.', 'I am Matsurugi.  People here call me the Village chief.;Our hometown is covered by snow and ice year round.; Harsh cold here, but the people here feel its extremely warm.', NULL, NULL),
(24, 'Okanechan', 'Okanechan', 103, 104, 105, 'Đổi lượng sang xu;Nói chuyện', 'Exchange Gold to Coin;Talk', 'Con hãy chăm đánh quái, làm nhiệm vụ để có thêm nhiều yên hơn;Online mỗi ngày tham gia các hoạt động để tích lũy điểm hoạt động con nhé.;Ta là hiện thân của thần tài sẽ mang tài lộc đến cho mọi người.', 'Defeating monsters and completing quests can be tiring; but all that work can help you accumulate a lot of points;  I bring good fortune to people by exchanging kin to coins.', NULL, NULL),
(25, 'Rikudou', 'Rikudou', 106, 107, 108, 'NV mỗi ngày,Nhận,Hủy,Hoàn thành,Đi làm NV;NV Truy bắt Tà Thú,Nhận,Hủy,Hoàn Thành;Chiến trường,Bạch Giả,Hắc Giả,Tổng kết,Hướng dẫn;Thất thú ải', 'Daily mission,Accept,Cancel,Accomplish,On duty;Wild Beast Hunt,Accept,Cancel,Accomplish;Yin Yang Battlefield,Yang side,Yin side,Summary,Help;Seven beasts gate', '', '', NULL, NULL),
