(28, 'Shinwa', 'Shinwa', 128, 129, 130, 'Gian hàng,Đá,Nón,Vũ khí,Áo,Dây chuyền,Găng tay,Nhẫn,Quần,Ngọc bội,Giày,Bùa,Linh tinh;Bán vật phẩm', 'Shop,Stone,Cap,Weapon,Cloth,Necklace,Gloves,Rings,Cloths,Gems,Shoes,Charms,Miscellaneous;Sale', '', '', NULL, NULL),
(29, 'Chị Hằng', 'Chị Hằng', 131, 132, 133, 'Làm bánh,Bánh thập cẩm,Bánh dẻo,Bánh đậu xanh,Bánh pía;Đóng hộp,Hộp bánh thường,Hộp bánh thượng hạng;Hướng dẫn,Cách làm bánh,Tìm Thần Thố,Tìm lồng đèn;Nói chuyện', 'Bakery,Mixed Mooncake,Jelly Mooncake,Green Mooncake,Purple Mooncake;Gift Box,Cake Box,Premium Cake Box;Guide,Baking,Lanterns,Boss;Talk', 'Có bầu có bạn can chi tủi. Cùng gió cùng mây thế mới vui. Rồi cứ mỗi năm rằm tháng tám. Tựa nhau trông xuống thế gian cười.', 'Hey diddle diddle, the cat and the fiddle, the cow jumped over moon.  The little dog laughed to see such a sight and the dish ran away with the spoon.', NULL, NULL),
