INSERT INTO `nin_skill_template` (`id`, `classId`, `name`, `name_en`, `maxPoint`, `type`, `iconId`, `description`, `description_en`) VALUES
(0, 0, 'Chiêu cơ bản', 'Skill Basic', 0, 1, 318, 'Đòn đánh cơ bản sử dụng sức mạnh bản thân gây sát thương lên kẻ địch', 'Basic strikes using body power to damage enemies'),
(1, 1, 'Chiêu Hiyoko', 'Skill Hiyoko', 12, 1, 319, 'Kiếm pháp nhập môn - vung kiếm vào một mục tiêu gây sát thương lên mục tiêu đó', 'Basic Sword skill to damage target'),
(2, 1, 'Chiêu Amagedon', 'Skill Amagedon', 6, 0, 601, 'Nhẫn thuật tâm pháp - nâng cao khả năng tấn công và phòng thủ', 'Shinobi mind power improves both offensive and defensive'),
(3, 1, 'Chiêu Jizokuzan', 'Skill Jizokuzan', 12, 1, 320, 'Chém liên tục 3 nhát kiếm gây sát thương cho một mục tiêu nhất định', '3 continuous strikes to damage a given target'),
(4, 1, 'Chiêu Kakyuu', 'Skill Kakyuu', 6, 3, 602, 'Sử dụng hỏa thuật thiêu đốt quái vật biến chúng thành thức ăn', 'Burn monsters by fire and turn them into food'),
(5, 1, 'Chiêu X Zangeki', 'Skill X Zangeki', 12, 1, 321, 'Xuất ra đường kiếm nhanh nhẹn đan chéo gây sát thương tối đa lên 3 mục tiêu', 'Damage up to 3 targets with quick slashing technique'),
(6, 1, 'Chiêu Raikou', 'Skill Raikou', 6, 2, 603, 'Làm cho bản thân tàng hình trước kẻ thù đồng thời gây chí mạng ở nhát đánh đầu tiên trong trạng thái tàng hình', 'Turn invisible and hit enemy with fatal first strike'),
(7, 1, 'Chiêu Hihebun', 'Skill Hihebun', 12, 1, 322, 'Tạo ra cơn mưa kiếm, gây sát thương cực lớn lên một mục tiêu', 'Rain of swords that causes massive damage to target'),
(8, 1, 'Chiêu Shuurai', 'Skill Shuurai', 6, 0, 604, 'Tăng khả năng kháng phong đồng thời giúp bản thân nhanh chóng hồi phục khi bị choáng', 'Increase anti super skill and fast recover when stunned'),
(9, 1, 'Chiêu Choukouhirenzo', 'Skill Choukouhirenzo', 12, 1, 323, 'Xuất ra 3 hỏa kiếm cường mạnh gây sát thương trong một phạm vi nhất định, tối đa 4 mục tiêu', 'Power 3 fire damage within a certain range (max 4 targets)'),
(10, 2, 'Chiêu Otama', 'Skill Otama', 12, 1, 596, 'Tiêu thuật nhập môn - phóng phi tiêu gây sát thương lên một mục tiêu nhất định', 'Entry-level Shuriken throwing skill to damage a given target'),
(11, 2, 'Chiêu Itotama', 'Skill Itotama', 6, 0, 621, 'Nhẫn thuật tâm pháp - nâng cao khả năng tấn công và phản đòn', 'Spirit eyes skill to improve attack and counter attack ability'),
(12, 2, 'Chiêu Kasoushuriken', 'Skill Kasoushuriken', 12, 1, 597, 'Phóng 2 phi tiêu liên tục gây sát thương cho một mục tiêu nhất định', 'Throw 2 shurikens continuously at a given target'),
(13, 2, 'Chiêu Taiyoutama', 'Skill Taiyoutama', 6, 2, 622, 'Sử dụng hỏa thuật triều hồi vòng lửa vô hình thiêu đốt các mục tiêu bản thân tấn công', 'Summon fire to burn all targets you want to attack'),
(14, 2, 'Chiêu Bikoushuriken', 'Skill Bikoushuriken', 12, 1, 598, 'Vận dụng hỏa thuật đốt cháy phi tiêu phóng đi gây sát thương tối đa lên 3 mục tiêu', 'Magic fire will burn all enemies and protect against any thrown shurikens '),
(15, 2, 'Chiêu Hoshitama', 'Skill Hoshitama', 6, 2, 623, 'Sử dụng ẩn thân thuật để bản thân trở nên vô hình đồng thời hồi phục hp và mp trong một thời gian xác định', 'Become invisible and restore HP / MP for a specified time'),
(16, 2, 'Chiêu Hinotama', 'Skill Hinotama', 12, 1, 599, 'Trong chớp mắt phóng 2 phi tiêu bốc cháy về phía kẻ địch, gây ra lượng sát thương cực lớn', 'Quick throw 2 shurikens toward enemy fire, causing huge damage'),
(17, 2, 'Chiêu Hijoukai', 'Skill Hijoukai', 6, 0, 624, 'Tăng khả năng kháng phong đồng thời giúp bản thân nhanh chóng hồi phục khi bị choáng', 'Increase anti Wind and also fast recover when stunned'),
(18, 2, 'Chiêu Choukou shuriken', 'Skill Choukou shuriken', 12, 1, 600, 'Phóng ra một Phi Tiêu lớn kèm theo lửa gây sát thương trong một phạm vi nhất định, tối đa 4 mục tiêu', 'Magic fire burns big shurikens and up to 4 enemies at the same time '),
(19, 3, 'Chiêu Yokobatan', 'Skill Yokobatan', 12, 1, 550, 'Kunai nhập môn - tấn công gây sát thương lên một mục tiêu nhất định', 'Basic Kunai skill to damage a given target'),
(20, 3, 'Chiêu Akaiame', 'Skill Akaiame', 6, 0, 605, 'Nhẫn thuật tâm pháp - nâng cao khả năng tấn công độ chính xác và tốc độ di chuyển', 'Mind Ninjutsu improves precision attack and movement speed'),
(21, 3, 'Chiêu Mizuibatan', 'Skill Mizuibatan', 12, 1, 577, 'Chém liên tục vào mục tiêu gây sát thương lên mục tiêu đó', 'Continuous damage caused by repeated slashing of target'),
(22, 3, 'Chiêu Aoiame', 'Skill Aoiame', 6, 2, 606, 'Tạo ra khúc gỗ thế thân chịu mọi sát thương thay cho bản thân', 'Create a protective log to absorb all damage'),
(23, 3, 'Chiêu Uzubatan', 'Skill Uzubatan', 12, 1, 578, 'Kunai kết hợp băng thuật tạo ra vòng sát thương tác động lên các mục tiêu cạnh đó, tối đa 3 mục tiêu', 'Create a massive air blade to damage up to 3 targets'),
(24, 3, 'Chiêu Hibikou', 'Skill Hibikou', 6, 1, 607, 'Sử dụng cầm băng thuật trói chân kẻ địch trong một khoảng thời gian nhất định', 'Freeze enemy for a specified time'),
(25, 3, 'Chiêu Kogoeru', 'Skill Kogoeru', 12, 1, 579, 'Tạo 2 vòng băng quấn quanh mục tiêu, gây ra sát thương cực lớn', 'Damage target by creating two moving ice circles'),
